import React from 'react'
import Logo from "../../assets/logo.gif"
import "./header.css"

function Header () {
  return (
    <header className="just_header">
      <h1>just for dream</h1>
      <img
        src={Logo}
        alt="just-for-dream"
        className="logo_Nelly"
      />
    </header>
  );
}

export default Header
